The Resource interface can be used to gain access to
shared resources.  It is always offered as a parameterized
interface, and its users gain access to the resource through some
predefined arbitration policy.

@author Kevin Klues (klueska@cs.wustl.edu)
@version $Revision: 1.6 $
@date $Date: 2010-06-29 22:07:46 $

SPI Packet/buffer interface for sending data over an SPI bus. This interface provides a split-phase send command which can be used for sending, receiving or both. It is a "send" command because reading from the SPI requires writing bytes. The send call allows NULL parameters for receive or send only operations. This interface is for buffer based transfers where the microcontroller is the master (clocking) device.
Often, an SPI bus must first be acquired using a Resource interface before sending commands with SPIPacket. In the case of multiple devices attached to a single SPI bus, chip select pins are often also used.
@author Philip Levis @author Jonathan Hui @author Joe Polastre Revision: $Revision: 1.8 $

Send a message over the SPI bus.

@param 'uint8_t* COUNT_NOK(len) txBuf' A pointer to the buffer to send over the bus. If this
             parameter is NULL, then the SPI will send zeroes.
@param 'uint8_t* COUNT_NOK(len) rxBuf' A pointer to the buffer where received data should
             be stored. If this parameter is NULL, then the SPI will
             discard incoming bytes.
@param len   Length of the message.  Note that non-NULL rxBuf and txBuf
             parameters must be AT LEAST as large as len, or the SPI
             will overflow a buffer.

@return SUCCESS if the request was accepted for transfer

Notification that the send command has completed.

@param 'uint8_t* COUNT_NOK(len) txBuf' The buffer used for transmission
@param 'uint8_t* COUNT_NOK(len) rxBuf' The buffer used for reception
@param len    The request length of the transfer, but not necessarily
              the number of bytes that were actually transferred
@param error  SUCCESS if the operation completed successfully, FAIL
              otherwise

 This is a natural extension of the SpiByte interface which allows fast 
 data transfers comparable to the SpiStream interface. You may want to
 use the following code sequence to write a buffer as fast as possible

	uint8_t *data;
	uint8_t *response;

	// start the first byte
	call FastSpiByte.splitWrite(data[0]);
	for(i = 1; i < length; ++i) {
	   // finish the previous one and write the next one
	  response[i-1] = call FastSpiByte.splitReadWrite(data[i]);
	}
	// finish the last byte
	response[length-1] = call FastSpiByte.splitRead();

 You can also do some useful computation (like calculate a CRC) while the
 hardware is sending the byte.

